import { useEffect, useState } from "react";
import Tile from "./Tile";

function App() {
  const [dates, setDate] = useState([]);

  useEffect(() => {
    fetch("/dates")
      .then((r) => r.json())
      .then((dates) => setDate(dates));
  }, []);

  return <Tile dates={dates} />;

  // return <h1>Check the console for a list of dates!</h1>;
}

export default App;
